parametrizedQuery.queryDefinition:
select minTime, maxTime,
TO_INT(avgTime * 100)/100.0 as avgTime
from WaitTimeStatsCurrent;

select to_int(((p.allProviders - cvp.busyProviders)*100)/p.allProviders) as occ
from 
 (select count(*) as busyProviders
  from (select providerId from CurrentVisitStatus group by providerId) vr) cvp, 
 (select count(*) as allProviders from Providers) p;
